import { Text, SafeAreaView, View } from "react-native";
import React from "react";
import AppBar from "../../components/Reusable/Appbar";

const Recommended = () => {
  return (
    <SafeAreaView>
      <View style={{ height: 80 }}>
        <AppBar />
      </View>
    </SafeAreaView>
  );
};

export default Recommended;
